import  * as React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import HomeScreen from "./screens/Home";
import ConsentScreen from "./screens/Consent";
import PhraseBackUpScreen from "./screens/PhraseBackUp";
import CreateStepThreeScreen from "./screens/CreateStepThree";
import CreateStepFourScreen from "./screens/CreateStepFour";
import YourPhraseScreen from "./screens/YourPhrase";

const Stack = createNativeStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={HomeScreen} options={{ title: "Welcome" }}/>
        <Stack.Screen name="Consent" component={ConsentScreen} />
        <Stack.Screen name="YourPhrase" component={ConsentScreen} />
        <Stack.Screen name="Back Up Your Phrase" component={PhraseBackUpScreen} />
        <Stack.Screen name="CreateStepThree" component={CreateStepThreeScreen}/>
        <Stack.Screen name="CreateStepFour" component={CreateStepFourScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
